script: |
  super -f tsv -I q894.sql | sort > q894.out

vector: true

inputs:
  - name: q894.sql
    data: |
      SELECT DISTINCT col0 AS col1 FROM tab2 WHERE NOT + + col1 + + + col0 NOT BETWEEN + - col2 AND - - col0 * + + col2 + col0;
  - name: tab2

outputs:
  - name: q894.out
    data: |
      46
      64
      75
